<template>
  <div class="markdown-container">
    <div v-html="formattedMarkdown"></div>
  </div>
</template>

<script>
import MarkdownIt from 'markdown-it';

export default {
  data() {
    return {
      markdown: `
# ©️ Projetos Realizados

[![Happy](https://curriculo-vitae-web.web.app/static/media/icon_happy.29f5fbb3.png "Projeto Happy")](https://github.com/JacksonSantin/Happy_NLW3)
[![Proffy](data:image/png;base64, "Projeto Proffy")](https://github.com/JacksonSantin/proffy)
[![Shopping](data:image/png;base64, "Projeto Shopping")](https://github.com/JacksonSantin/shopping)
[![Busca CEP](data:image/png;base64, "Projeto Busca CEP")](https://github.com/JacksonSantin/API_Correios)
[![Bot Discord](https://curriculo-vitae-web.web.app/static/media/discord_image_portfolio.8333721f.jpg "Projeto Bot Discord - Lembretes")](https://github.com/JacksonSantin/bot-discord)
[![API RESTful](data:image/jpeg;base64, "Projeto RESTfull com aplicação Web")](https://github.com/JacksonSantin/api-web-person)



`

    };
  },
  computed: {
    formattedMarkdown() {
      const md = new MarkdownIt({
        html: true,
        linkify: true,
        typographer: true,
        highlight: (code, lang) => {
          if (lang && Prism.languages[lang]) {
            const highlightedCode = Prism.highlight(
              code,
              Prism.languages[lang],
              lang
            );
            return `<pre class="language-${lang}"><code>${highlightedCode}</code></pre>`;
          }
          // fallback to default behavior
          return `<pre class="language-plaintext"><code>${md.utils.escapeHtml(
            code
          )}</code></pre>`;
        },
      });
      return md.render(this.markdown);
    },
  },
};
</script>

<style scoped>
.markdown-container {
  background-color: #24292e;
  padding: 10px;
  color: white;
}
</style>